import styled from "styled-components";
export const Div = styled.div`
	display: flex;
	flex-direction: column;
  align-items: center;
    justify-content:center;
    background: rgb(2, 0, 36);
    background: linear-gradient(
      90deg,
      rgba(2, 0, 36, 1) 0%,
      rgba(232, 13, 187, 1) 13%,
      rgba(0, 212, 255, 1) 100%
    );
}`;
